function l (x) {console.log(x)}
function numify (x) {return parseInt(x, 10)}
function tob15 (x) {rv = numify(x).toString(15); return (rv.length==1?"0":"") + rv} // adds the zeros

let tokens = "King, Sapling, Tree, BonePile, StonePillar, PhoenixEgg, PhoenixEgg+, PhoenixEgg++, PhoenixEgg+++, Sorceress, GeminiTwin, GeminiTwin+, GeminiTwin++, GeminiTwin+++, ChaosPortal, Dummy, SuperDummy, MageDummy".split(", ")

//delete CEO.v43

for (x in CEO) {

  let data = CEO[`${x}`].split("UnitLibrary.sort();")[0].split("new Object();")
  let actiondescriptions = CEO[`${x}`].split("UnitLibrary.sort();")[1]
  CEO[x] = {}

  for (i=1; i < data.length; i++) { // NOTE: i=1, because we're skipping the first piece of nonsense text
    let y = data[i]
    y = (/Name = "(.*?)";/gi).exec(y)[1].replace("+++", "4").replace("++", "3").replace("+", "2")
    // Use this name as a definition - CEO[`${x}`][`${y}`] = CEO.v49.Nexus, for example
    // Also, imagine having to replace the +'s with the numbers because JS doesn't allow plusses in object keys

    CEO[`${x}`][`${y}`] = {}

    CEO[`${x}`][`${y}`].cost   = ((/Cost = (\d+);/gi).exec(data[i])[1])
    CEO[`${x}`][`${y}`].rarity = ((/Rarity = "(.*?)";/gi).exec(data[i])[1])
    CEO[`${x}`][`${y}`].movesraw  = ((/Moves = \[(.+)\]/gi).exec(data[i])[1])

    let movetypes = ((/MoveTypes = \[(.*?)\]/gi).exec(data[i])[1]).split(",") // Using this as help for the formatted moves

    // We're gonna need to FIX that ridiculous convention of 1 = empty square, hmmmm?
    let movetypesformatted = ((/Moves = \[(.+)\]/gi).exec(data[i])[1]).split(",").map(x => (numify(x)-1).toString()) // isn't joined
    let typeslist = []

    for (j=0; j < movetypes.length; j++) {
      let movetypenumber = (movetypes[j]-1).toString() // MINUS ONE TO MATCH!

      typeslist.push(`${movetypenumber}:${movetypesformatted.reduce(function(array, element, index) {if (element == movetypenumber) array.push(tob15(index)); return array;}, []).join("")}`) // Filter for only the numbers that match the movetype, and push the hex'd index
    }
    CEO[`${x}`][`${y}`].movespmformat = typeslist.join(",")

    if (CEO[`${x}`][`${y}`].movespmformat == "-1:") {CEO[`${x}`][`${y}`].movespmformat = ""}


    try {
      CEO[`${x}`][`${y}`].passive = ((/Passive = "(.*?)";/gi).exec(data[i].replace(/\n/g,"\\n").replace(/,/g,"\\a").replace(/</g, "&lt;").replace(/>/g, "&gt;"))[1])
      // MY GOD JAVASCRIPT SUCKS I HAVE TO REGEX REPLACE THIS BECAUSE REPLACE IS DEFAULT ONLY ONE
    } catch (TypeError) {}
    try {
      CEO[`${x}`][`${y}`].class = ((/Minion = (.*?);/gi).exec(data[i])[1])
      CEO[`${x}`][`${y}`].class = "Minion"
    } catch (TypeError) {
      CEO[`${x}`][`${y}`].class = "Champion"
      if (tokens.includes(y)) {CEO[`${x}`][`${y}`].class = ""}
    }
  }
}

